import { AddUser } from './AddUser';
import Checkbox from '@material-ui/core/Checkbox';
import DeleteIcon from '@material-ui/icons/Delete';
import './style.scss';

import axios from 'axios';
import { useState } from 'react';

export const UserList = () => {
	const [user, setUser] = useState('');
	axios({
		method: 'GET',
		url: 'https://60517468534609001767198c.mockapi.io/api/user',
		data: null,
	})
		.then((res) => {
			setUser(res.data);
			// console.log(res.data);
		})
		.catch((err) => {
			console.log(err);
		});
	const addUser = (user) => {
		console.log('user', user);
	};
	console.log('type', typeof user);

	const userItem = user.map((item, index) => {
		return (
			<tr>
				<td>
					<Checkbox inputProps={{ 'aria-label': 'uncontrolled-checkbox' }} />
				</td>
				<td>{item.id}</td>
				<td>{item.name}</td>
				<td>{item.email}</td>
				<td>{item.role}</td>
				<td>{item.phone}</td>
				<td>
					<div className='action'>
						<DeleteIcon />
					</div>
				</td>
			</tr>
		);
	});

	return (
		<div className='User-List'>
			<div className='Add-user'>
				<AddUser newUser={addUser} />
			</div>
			<div className='table-user table-wrapper'>
				<div className='TableUser'>
					<div className='TableUser__search'>
						<button className='button_blue'>xóa user</button>
						<input placeholder='Tìm kiếm tại đây...'></input>
					</div>
					<div className='TableUser__list'>
						<table>
							<thead>
								<tr>
									<th>
										<Checkbox inputProps={{ 'aria-label': 'uncontrolled-checkbox' }} />
									</th>
									<th>User ID</th>
									<th>Tên đăng nhập</th>
									<th>Số điện thoại</th>
									<th>Email</th>
									<th>Vai trò</th>
									<th>Thao tác</th>
								</tr>
							</thead>
							<tbody></tbody>
						</table>
					</div>
				</div>
			</div>
		</div>
	);
};
